import AppHeader from '../App/AppHeader/header';
import MainPage from '../App/MainPage/MainPage';
import Footer from '../App/AppFooter/Footer';
import MainPageCon from '../App/MainPage/MainPageCon'; // Импортируйте новый компонент
import { ThemeProvider } from '../App/ThemeSwitch/ThemeContext';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

const App = () => {
  return (
    <ThemeProvider>
      <Router>
        <AppHeader />
        <Routes>
          <Route path="/" element={<MainPage />} />
          <Route path="/main" element={<MainPageContainer />} /> {/* Добавьте новый маршрут */}
        </Routes>
        <Footer/>
      </Router>
    </ThemeProvider>
  );
};

export default App;
